description:
■ＢＭＷの大きな特徴、エンジェルアイ (イカリング)をさらにクールに。<br>
　高輝度ＬＥＤを採用し、その明るさはなんと６０００ケルビン相当。<br>
　ＨＩＤに負けないくらいのホワイトの輝きに加え、ＨＩＤとの相性も抜群。<br>
　目元をもっと際立たせ、愛車をもっと上品にしてくれるＬＥＤバルブです。<br>
<br>
■超発光、強力な5Ｗ/ＬＥＤを使用し、さらに光の伝達を効率よくするためにＬＥＤ台座をすり鉢状に加工。<br>
　アルミヒートシンクボディにすることで放熱性も飛躍的に向上させました！<br>
<br>
■5Ｗ/6000Ｋ相当の激光LED採用。大型の放熱板を採用したことにより、その寿命は15000時間以上。<br>

<br>
<br>
【適合車種】<br>
■1シリーズ<br>
　E87 前期 純正キセノンヘッドライト車<br>
※純正ハロゲンヘッドライト車へは不適合<br>

■5シリーズ<br>
　E60 前期 セダン 純正キセノンヘッドライト車<br>
　E61 前期 ツーリング 純正キセノンヘッドライト車<br>
　E39 後期 セダン / ツーリング のみ<br>

■6シリーズ<br>
　E63 前期 クーペ<br>
　E64 前期 カブリオレ<br>

■7シリーズ<br>
　E65 前期＆後期<br>
　E66 前期＆後期<br>

■X3 E83 後期のみ<br>
■X5 E53 後期のみ<br>
【セット内容】<br>
BMWイカリング用5ＷＬＥＤバルブ×2<br>
<br>
【出力】<br>
5Ｗ12Ｖ<br>
<br>
■同梱に関して■<br>
こちらの商品は同梱手数料＋1000円頂いております。<br>
